import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expense(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        name={props.expenses_array[0].title}
        charge={props.expenses_array[0].amount}
        date={props.expenses_array[0].date}
      ></ExpenseItem>
      <ExpenseItem
        name={props.expenses_array[1].title}
        charge={props.expenses_array[1].amount}
        date={props.expenses_array[1].date}
      ></ExpenseItem>
      <ExpenseItem
        name={props.expenses_array[2].title}
        charge={props.expenses_array[2].amount}
        date={props.expenses_array[2].date}
      ></ExpenseItem>
      <ExpenseItem
        name={props.expenses_array[3].title}
        charge={props.expenses_array[3].amount}
        date={props.expenses_array[3].date}
      ></ExpenseItem>
    </div>
  );
}
export default Expense;
